:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Emily Jane and GRAY, Charles
  JGRAY, Donald Camplin and HAY, Frances Ethel
  IGRAY, Maxwell Camplin and REED, Christine Stewart
  GRAY, Maxwell Camplin and REED, Christine Stewart (cont...)
  Unfortunately, Max's heart become troublesome and eventually required a by-pass operation which was
  successful. However, as he became older, his heart condition slowly deteriorated over the remaining
  years and eventually required extensive medication, periods in hospital and considerable discomfort
  which he bore over a long period with great courage, supported with loving care by Christine until his
  death.
  Max was a man of outstanding integrity, upright, honest, completely loyal to those around him and
  generous in his support of his family and friends.
  02> GRAY, Godfrey Brett m on 14.04.1948 to HEGARTY, Sheila Monica
  b 21.09.1914
  b 31.10.1922
  Brett b. at "Waiohika", Gisborne. Sheila, d/o William and Agnes Hegarty of Pymble, NSW, Australia.
  Address: 14c Ruataniwha Street, Waipawa.
  Brett went to Essex House in Gisborne for his early schooling, then to Gisborne High School and to
  Wanganui Collegiate School in 1929-31. He was a member of the rowing crew in 1931. After leaving
  school he worked on farms on the East Coast then joined the Army and served in Greece, North Africa and
  Italy. He was a sergeant in the 7th Anti Tank Regiment. In 1945 he managed "Hore Hore" station out
  from Ruatoria, a property where everything came in and out by packhorse. He then moved to Gisborne to
  manage "Waiohika", the family station.
  Brett met Sheila when she was visiting relatives in the Gisborne district. After their marriage they
  lived at "Waiohika" until Brett drew a Rehab farm at Argyll. He farmed there until his retirement and
  now lives in Waipawa.
  01> GRAY, Camplin William m on 01.09.1973 to COMPTON, Karen
  b 22.01.1949
  b 15.01.1952
  Address: RD 6, Te Puke.
  Cam was educated at St Patrick's College, Silverstream, and is now a dairy farmer. He is a keen
  hunter and enjoys sailing. Karen works in livestock improvement,
